import React from 'react'

function Signup() {
  return (
    <div>
        <h1>Register</h1>
        <input type="text" placeholder='ENTER NAME' />
        <input type="text" placeholder='ENTER PASSWORD' />
        <input type="text" placeholder='ENTER NAME' />
    </div>
  )
}

export default Signup;
